//((0, 1, 2, 3), (1, 0, 3, 2), (2, 3, 0, 1), (3, 2, 1, 0))
//[12, 9, 6, 3, 8, 13, 2, 7, 4, 1, 14, 11, 0, 5, 10, 15]
void BOGI64_omega_diffusion_0(DIFF_O_WRD_t * out, DIFF_I_WRD_t * in)
{
	uint64_t x = 0;
	int i;

	for (i = 0; i < 16; i++)
	{
		x = (x << 4) | (in[i] & 0xf);
	}
	// 31 cycles, 16 masks
	x = (x & 0x1000010000100001)
		| ((x & 0x0200008000024000) << 4)
		| ((x & 0x0040000420000800) << 8)
		| ((x & 0x0008100001000010) << 12)
		| ROL64(x & 0x8000020000800002, 16)
		| ROL64(x & 0x0400004000042000, 20)
		| ROL64(x & 0x0020000810000100, 24)
		| ROL64(x & 0x0001800002000080, 28)
		| ROL64(x & 0x4000040000400004, 32)
		| ROL64(x & 0x0800002000081000, 36)
		| ROL64(x & 0x0010000180000200, 40)
		| ROL64(x & 0x0002400004000040, 44)
		| ROL64(x & 0x2000080000200008, 48)
		| ((x & 0x0100001000018000) >> 12)
		| ((x & 0x0080000240000400) >> 8)
		| ((x & 0x0004200008000020) >> 4);

	for (i = 15; i >= 0; i--)
	{
		out[i] = (DIFF_O_WRD_t)(x & 0xf);
		x = x >> 4;
	}
}

